function sum(...e){let n=0;for(let t of e)n+=t;return n}let x=sum(11,12,13);document.getElementById("demo").innerHTML="Sum of 11+12+13 => "+x;class Person{constructor(e,n,t){this.fname=e,this.lname=n,this.profession=t}get fullname(){return this.fname+"-"+this.lname}get position(){return"Position: "+this.profession}}const person=new Person("Bryanna","Gardner","Front-End Developer");document.getElementById("name").innerHTML=person.fname+" "+person.lname,document.getElementById("position").innerHTML=person.position;